<?php
declare(strict_types=1);

namespace UCRM\REST\Endpoints;

use UCRM\REST\Endpoints\Lookups\TicketActivityComment;


class TicketTests extends EnpointTestCase
{

    // =================================================================================================================
    // TICKET TESTS - GETTERS
    // =================================================================================================================

    public function testAllGetters()
    {
        /** @var Ticket $ticket */
        $ticket = Ticket::get()->last();
        $this->assertNotNull($ticket);

        $this->outputGetters($ticket);
    }

    // =================================================================================================================
    // TICKET TESTS - CREATE
    // =================================================================================================================

    /**
     * @covers Ticket->insert()
     * @throws \Exception
     */
    public function testTicketInsert()
    {
        /** @var Ticket $ticket */
        //$ticket = Ticket::createNewWithComment(1, "Test Ticket", "This is a starting comment!");
        $ticket = new Ticket();
        $ticket->setSubject("Test Ticket");
        $ticket->setClientId(1);

        //$comment = new TicketActivityComment();
        $comment = new TicketComment();
        $comment->setBody("This is a test comment!");

        $activity = new TicketActivity();
        $activity->setComment($comment);

        $ticket->setActivity([$activity]);

        /** @var Ticket $insertedTicket */
        $insertedTicket = $ticket->insert();
        $this->assertEquals("Test Ticket", $insertedTicket->getSubject());

        $this->outputResults($insertedTicket);
    }

    /**
     * @covers Ticket::addComment()
     */
    public function testAddTicketComment()
    {
        /** @var Ticket $ticket */
        $ticket = Ticket::get()->last();

        $updatedTicket = $ticket->addComment("This is a another comment!");

        $this->outputResults($updatedTicket);

    }



    /**
     * @covers Ticket::addMimeAttachments()
     */
    public function testAddTicketMimeAttachments()
    {
        $test1 = "";
        $test2 = "";

        /** @var Ticket $ticket */
        $ticket = Ticket::get()->last();

        //$updatedTicket = $ticket->addMimeAttachments([ "test1.png" => $test1, "test2.png" => $test2 ]);
        $updatedTicket = $ticket->addMimeAttachment("test1.png", $test1, "This is a test upload", true);

        $this->outputResults($updatedTicket);

    }








}
